import googleIcon from "assets/images/logo/googleIcon.png" 

const LoginButton = () => {
    
    return(
        <div className="flex justify-center h-[60%] mt-[1%]">
            <div className="h-[50%] w-[75%] bg-white border border-black rounded-xl">
                <img src={googleIcon} className="h-[50%]"/>
                <div>구글 계정으로 계속하기</div>
            </div>
        </div>
    )
}

export default LoginButton;
